class AutocompleteDropdown {
  constructor(data, inputElement) {
    this.input = inputElement;
    this.data = data;
    this.activeIndex = -1;

    this.dropdown = document.createElement("div");
    this.setupDropdown();
    document.body.appendChild(this.dropdown);

    this.bindEvents();
  }

  setupDropdown() {
    const d = this.dropdown;
    d.style.position = "absolute";
    d.style.background = "#fff";
    d.style.border = "1px solid #ccc";
    d.style.maxHeight = "200px";
    d.style.overflowY = "auto";
    d.style.display = "none";
    d.style.zIndex = "1000";
  }

  positionDropdown() {
    const rect = this.input.getBoundingClientRect();
    this.dropdown.style.top = rect.bottom + window.scrollY + "px";
    this.dropdown.style.left = rect.left + window.scrollX + "px";
    this.dropdown.style.width = rect.width + "px";
  }

  filterData(value) {
    const v = value.toLowerCase();

    return this.data.filter(item => {
      const lower = item.toLowerCase();
      const number = item.split(" - ")[0];
      return lower.includes(v) || number.startsWith(v);
    });
  }

  render(items) {
    this.dropdown.innerHTML = "";
    this.activeIndex = -1;

    items.slice(0, 10).forEach(itemText => {
      const item = document.createElement("div");
      item.textContent = itemText;
      item.style.padding = "8px";
      item.style.cursor = "pointer";

      item.addEventListener("mouseenter", () => {
        this.clearActive();
        item.style.background = "#f0f0f0";
      });

      item.addEventListener("mouseleave", () => {
        item.style.background = "#fff";
      });

      item.addEventListener("click", () => {
        this.input.value = itemText;
        this.hide();
      });

      this.dropdown.appendChild(item);
    });
  }

  updateActive() {
    const items = this.dropdown.children;
    if (!items.length || this.activeIndex === -1) return;

    [...items].forEach((el, i) => {
      el.style.background = i === this.activeIndex ? "#f0f0f0" : "#fff";
    });

    this.input.value = items[this.activeIndex].textContent;
    items[this.activeIndex].scrollIntoView({ block: "nearest" });
  }

  clearActive() {
    [...this.dropdown.children].forEach(el => {
      el.style.background = "#fff";
    });
  }

  show() {
    this.positionDropdown();
    this.dropdown.style.display = "block";
  }

  hide() {
    this.dropdown.style.display = "none";
    this.activeIndex = -1;
  }

  bindEvents() {
    this.input.addEventListener("input", () => {
      const value = this.input.value.trim();

      if (!value) {
        this.hide();
        return;
      }

      const results = this.filterData(value);

      if (results.length) {
        this.render(results);
        this.show();
      } else {
        this.hide();
      }
    });

    this.input.addEventListener("keydown", (e) => {
      const items = this.dropdown.children;
      if (!items.length) return;

      if (e.key === "ArrowDown") {
        e.preventDefault();
        this.activeIndex =
          this.activeIndex === items.length - 1 ? 0 : this.activeIndex + 1;
        this.updateActive();
      }

      if (e.key === "ArrowUp") {
        e.preventDefault();

        if (this.activeIndex === -1) {
          this.activeIndex = items.length - 1; // correct first-up behavior
        } else {
          this.activeIndex =
            this.activeIndex === 0 ? items.length - 1 : this.activeIndex - 1;
        }

        this.updateActive();
      }

      if (e.key === "Enter" && this.activeIndex !== -1) {
        e.preventDefault();
        items[this.activeIndex].click();
      }

      if (e.key === "Escape") {
        this.hide();
      }
    });

    window.addEventListener("resize", () => this.positionDropdown());
    window.addEventListener("scroll", () => this.positionDropdown());

    document.addEventListener("click", (e) => {
      if (e.target !== this.input && !this.dropdown.contains(e.target)) {
        this.hide();
      }
    });
  }
}


class searchFinder {
    constructor(data, inputBox) {
        this.data = data;
        this.inputBox = inputBox;
        this.dropdown = document.createElement("div");

        this.dropdown.style.position = "absolute";
        this.dropdown.style.border = "1px solid #ccc";
        this.dropdown.style.background = "#fff";
        this.dropdown.style.maxHeight = "200px";
        this.dropdown.style.overflowY = "auto";
        this.dropdown.style.zIndex = "1000";
        this.dropdown.style.display = "none";

        document.body.appendChild(this.dropdown);

        this.lastMatch = [];
        this.activeIndex = -1;

        this.bindEvents();
    }

    bindEvents() {
        this.inputBox.addEventListener("input", (e) => {
            this.activeIndex = -1;
            this.search(this.inputBox.value);
        });

        this.inputBox.addEventListener("keydown", (e) => {
            const items = this.dropdown.children;
            if (!items.length) return;

            if (e.key === "ArrowDown") {
                e.preventDefault();
                this.activeIndex = (this.activeIndex + 1) % items.length;
                this.updateActive(items);
            }

            if (e.key === "ArrowUp") {
                e.preventDefault();

                if (this.activeIndex === -1) {
                    this.activeIndex = items.length - 1; // jump to last
                } else {
                    this.activeIndex =
                        (this.activeIndex - 1 + items.length) % items.length;
                }

                this.updateActive(items);
            }

            if (e.key === "Enter" && this.activeIndex !== -1) {
                e.preventDefault();
                items[this.activeIndex].click();
            }
        });

        document.addEventListener("click", (e) => {
            if (e.target !== this.inputBox) {
                this.dropdown.style.display = "none";
            }
        });
    }

    updateActive(items) {
        [...items].forEach((item, i) => {
            item.style.background =
                i === this.activeIndex ? "#eee" : "#fff";
        });

        this.inputBox.value = items[this.activeIndex].textContent;
    }

    search(query) {
        this.dropdown.innerHTML = "";
        this.activeIndex = -1;

        if (!query) {
            this.dropdown.style.display = "none";
            return;
        }

        const q = query.toLowerCase();
        let matches = [];

        if (q.length === 1) {
            matches = this.data.filter(item =>
                item.toLowerCase().startsWith(q)
            );
        } else {
            matches = this.lastMatch.filter(item =>
                item.toLowerCase().startsWith(q)
            );

            if (matches.length === 0) {
                const lastChar = q[q.length - 1];
                matches = this.lastMatch.filter(item =>
                    item.toLowerCase().includes(lastChar)
                );
            }
        }

        this.lastMatch = matches;
        matches = matches.slice(0, 5);

        if (!matches.length) {
            this.dropdown.style.display = "none";
            return;
        }

        const rect = this.inputBox.getBoundingClientRect();
        this.dropdown.style.left = rect.left + "px";
        this.dropdown.style.top = rect.bottom + window.scrollY + "px";
        this.dropdown.style.width = rect.width + "px";

        matches.forEach(match => {
            const option = document.createElement("div");
            option.textContent = match;
            option.style.padding = "8px";
            option.style.cursor = "pointer";

            option.addEventListener("mouseover", () => {
                option.style.background = "#eee";
            });

            option.addEventListener("mouseout", () => {
                option.style.background = "#fff";
            });

            option.addEventListener("click", () => {
                this.inputBox.value = match;
                this.dropdown.style.display = "none";
            });

            this.dropdown.appendChild(option);
        });

        this.dropdown.style.display = "block";
    }
}

